import React from 'react';
import { BrowserRouter , Routes , Route , Link } from "react-router-dom";

function Nav ({ texto }) {
	return (
		<nav>
		
			<NavLink to="/">Inicio</NavLink>
			<NavLink to="/map">Map</NavLink>
			<NavLink to="/contacto">Contacto</NavLink>
			
			<ul>
				<li>{texto} 1</li>
				<li>{texto} 2</li>
				<li>{texto} 3</li>
				<li>{texto} 4</li>
			</ul>
		</nav>
	);
}

export default Nav;
